import { React } from 'react'

import { Row, Col } from 'react-bootstrap'

import '../../styles/landingpage/categorybuttons.scss'

export default function CategoryButtons() {
 return (
    <Row id="categorybuttons">
      {
        ['Men', 'Women'].map((category, categoryindx)=> {
            return (
                <Col xs={2}
                     md={2}
                     lg={2}
                     key={categoryindx}>
                  <button className='categorybuttons-categorybutton'>{category}</button>
                </Col>
             
            )
        })
      }
    </Row>
 )
}
